package com.victor.widget;import android.content.Context;import android.graphics.Rect;import android.support.annotation.Keep;import android.support.design.widget.AppBarLayout;import android.support.design.widget.CoordinatorLayout;import android.support.v4.view.ViewCompat;import android.support.v4.view.WindowInsetsCompat;import android.util.AttributeSet;import android.view.View;@Keeppublic class InsetsScrollingViewBehavior extends AppBarLayout.ScrollingViewBehavior        implements InsetsCoordinatorLayout.WindowInsetsHandlingBehavior {    public InsetsScrollingViewBehavior() {    }    public InsetsScrollingViewBehavior(Context context, AttributeSet attrs) {        super(context, attrs);    }    @Override    public WindowInsetsCompat onApplyWindowInsets(CoordinatorLayout layout, View child,                                                  WindowInsetsCompat insets) {        return ViewCompat.onApplyWindowInsets(child, insets);    }    @Override    public boolean onApplyWindowInsets(CoordinatorLayout layout, View child, Rect insets) {        return WindowInsetsHelper.onApplyWindowInsets(child, insets);    }}